import React from "react";

function Row({
  id,
  firstName,
  lastName,
  email,
  phoneNumber,
  houseYard,
  suite,
  classYear,
  homeCity,
  homeState,
  contactStatus,
  pteStatus,
  registrationStatus,
  stageOfVotingProcess,
  whereRegistered,
}) {
  const data = [];
  for (let i = 0; i < props.length; i++) {
    data.push(<td>{props[i]}</td>);
  }

  return <tr>{{ data }}</tr>;
}

Row.defaultProps = {
  name: "no-name",
};

export default Row;
